import unittest
from IncreasingTripletSubsequence import Solution

class test_IncreasingTripletSubsequence(unittest.TestCase):
    def test(self):
        soln=Solution()
        self.assertTrue(soln.increasingTriplet([1,2,3,4,5]))
        self.assertFalse(soln.increasingTriplet([5,4,3,2,1]))
        self.assertTrue(soln.increasingTriplet([2,1,5,0,4,6]))
        self.assertTrue(soln.increasingTriplet([20,100,10,12,5,13]))
